import Foundation

func minimumBribes(q: [Int]) -> String {

	var minimum = 0

	//print(q)

	for (key, value) in q.enumerated() {
		//print("> q[\(key)] = \(value)")
		if value - key > 3 {
			//print("  Too chaotic! (\(value) bribed \(value-(key+1)) times to reach position [\(key)])<<")
			return "Too chaotic"
		} else if key+1 < value {
			//print("  q[\(key)] = \(value) bribed \(value-(key+1)) time(s)!")
		} else if key+1 > value {
			//print("  q[\(key)] = \(value) were begged!")
			//print("  ... will check positions [0 ..< \(key)] for greater members before")
			for i in 0..<(key) {
				//print("  ... q[\(key)] = \(value) comparing previous member q[\(i)] = \(q[i])")
				if (q[i] > value) {
					//print("  ... minimum will now be (\(minimum+1))! *********")
					minimum += 1
				}
			}
		} else {
			//print("  q[\(key)] is OK!")
		}
	}

	return String(minimum)
}



import XCTest

class HRTest: XCTestCase {
	func testMinimumBribes_0() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [1, 2, 3, 4, 5, 6, 7, 8, 9])

		// Assert
		XCTAssertEqual(result, "0")
	}

	func testMinimumBribes_1() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [2, 1, 5, 3, 4])

		// Assert
		XCTAssertEqual(result, "3")
	}

	func testMinimumBribes_2() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [2, 5, 1, 3, 4])

		// Assert
		XCTAssertEqual(result, "Too chaotic")
	}

	func testMinimumBribes_3() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [1, 2, 5, 3, 7, 8, 6, 4])

		// Assert
		XCTAssertEqual(result, "7")
	}

	func testMinimumBribes_4() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [5, 1, 2, 3, 7, 8, 6, 4])

		// Assert
		XCTAssertEqual(result, "Too chaotic")
	}

	func testMinimumBribes_5() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [1, 2, 5, 3, 4, 7, 8, 6])

		// Assert
		XCTAssertEqual(result, "4")
	}

	func testMinimumBribes_6() {
		// Assemble
		var result: String

		// Activate
		result = minimumBribes(q: [1, 5, 2, 3, 4])

		// Assert
		XCTAssertEqual(result, "Too chaotic")
	}

